CREATE OR ALTER PROCEDURE [dbo].[Report_partes_por_proyecto]
@idPassport nvarchar(100) = '1',
@startDate datetime2 = '20210301',
@endDate datetime2 = '20210301',
@startProject numeric = 0,
@endProject numeric = 0
AS
select distinct emp.ID as idEmployee, eg.FullGroupName, eg.EmployeeName, eg.GroupName,
(select top(1) substring(Value,1,50) from EmployeeUserFieldValues EUFV where EUFV.idemployee= emp.id and date<=cast(@endDate as date) and fieldname='Categoria' order by date desc) as Category ,
(select top(1) substring(Value,1,50) from EmployeeUserFieldValues EUFV where EUFV.idemployee= emp.id and date<=cast(@endDate as date) and fieldname='Centro de Trabajo' order by date desc) as Center,
(select top(1) substring(Value,1,50) from EmployeeUserFieldValues EUFV where EUFV.idemployee= emp.id and date<=cast(@endDate as date) and fieldname='Funcin' order by date desc) as Funcion,
(select top(1) substring(Value,1,50) from EmployeeUserFieldValues EUFV where EUFV.idemployee= emp.id and date<=cast(@endDate as date) and fieldname='Nivel' order by date desc) as Level,
(select top(1) substring(Value,1,50) from EmployeeUserFieldValues EUFV where EUFV.idemployee= emp.id and date<=cast(@endDate as date) and fieldname='Tipo de contrato' order by date desc) as ContractType,
(select top(1) substring(Value,1,50) from EmployeeUserFieldValues EUFV where EUFV.idemployee= emp.id and date<=cast(@endDate as date) and fieldname='Fecha nacimiento' order by date desc) as BirthDate,
(select top(1) substring(Value,1,50) from EmployeeUserFieldValues EUFV where EUFV.idemployee= emp.id and date<=cast(@endDate as date) and fieldname='Fecha alta' order by date desc) as StartDate,
(select top(1) substring(Value,1,50) from EmployeeUserFieldValues EUFV where EUFV.idemployee= emp.id and date<=cast(@endDate as date) and fieldname='Fecha fin contrato' order by date desc) as EndDate,
(select top(1) substring(Value,1,50) from EmployeeUserFieldValues EUFV where EUFV.idemployee= emp.id and date<=cast(@endDate as date) and fieldname='idParte' order by date desc) as idParte,
try_convert(decimal(10,2),isnull((select top(1) replace(substring(Value,1,50),',', '.') from EmployeeUserFieldValues EUFV where EUFV.idemployee= emp.id and date<=cast(@endDate as date) and fieldname='PrecioDieta' order by date desc),0)) as PrecioDieta,
try_convert(decimal(10,2),isnull((select top(1) replace(substring(Value,1,50),',', '.') from EmployeeUserFieldValues EUFV where EUFV.idemployee= emp.id and date<=cast(@endDate as date) and fieldname='PrecioMediaDieta' order by date desc),0)) as PrecioMediaDieta,
try_convert(decimal(10,2),isnull((select top(1) replace(substring(Value,1,50),',', '.') from EmployeeUserFieldValues EUFV where EUFV.idemployee= emp.id and date<=cast(@endDate as date) and fieldname='PrecioComida' order by date desc),0)) as PrecioComida,
(select top(1) datediff(yy,convert(smalldatetime,substring(Value,1,50),120),getdate()) from EmployeeUserFieldValues EUFV where EUFV.idemployee= emp.id and date<=cast(@endDate as date) and fieldname='Fecha nacimiento' order by date desc) as Age,
(select top(1) datediff(yy,convert(smalldatetime,substring(Value,1,50),120),getdate()) from EmployeeUserFieldValues EUFV where EUFV.idemployee= emp.id and date<=cast(@endDate as date) and fieldname='Fecha alta' order by date desc) as Antiquity,
pt.Fecha, pt.Parte, pt.Proyecto, pt.Kms, pt.HorasNormales, pt.HorasExtrasNormales, pt.HorasExtrasSabados, pt.HorasExtrasFestivo, pt.DietasPrimera, pt.DietasMedia, pt.DietasComida, pt.DietasPlusAltura,
-- Clculo del coste de las dietas por empleado
isnull(SUM(pt.DietasPrimera * TRY_CONVERT(DECIMAL(10,2), ISNULL((SELECT TOP(1) replace(substring(Value,1,50),',', '.') 
FROM EmployeeUserFieldValues EUFV 
WHERE EUFV.idemployee = emp.id AND date <= CAST(@endDate AS DATE) AND fieldname = 'PrecioDieta' 
ORDER BY date DESC), 0))) OVER (partition by emp.id),0) AS CosteDietas,
-- Clculo del coste de las dietas global
isnull(SUM(pt.DietasPrimera * TRY_CONVERT(DECIMAL(10,2), ISNULL((SELECT TOP(1) replace(substring(Value,1,50),',', '.') 
FROM EmployeeUserFieldValues EUFV 
WHERE EUFV.idemployee = emp.id AND date <= CAST(@endDate AS DATE) AND fieldname = 'PrecioDieta' 
ORDER BY date DESC), 0))) OVER (),0) AS TotalGlobalCosteDietas,
-- Clculo del coste de las MEDIA dietas por empleado
isnull(SUM(pt.DietasMedia * TRY_CONVERT(DECIMAL(10,2), ISNULL((SELECT TOP(1) replace(substring(Value,1,50),',', '.') 
FROM EmployeeUserFieldValues EUFV 
WHERE EUFV.idemployee = emp.id AND date <= CAST(@endDate AS DATE) AND fieldname = 'PrecioMediaDieta' 
ORDER BY date DESC), 0))) OVER (partition by emp.id),0) AS CosteMediasDietas,
-- Clculo del coste de las MEDIA dietas global
isnull(SUM(pt.DietasMedia * TRY_CONVERT(DECIMAL(10,2), ISNULL((SELECT TOP(1) replace(substring(Value,1,50),',', '.') 
FROM EmployeeUserFieldValues EUFV 
WHERE EUFV.idemployee = emp.id AND date <= CAST(@endDate AS DATE) AND fieldname = 'PrecioMediaDieta' 
ORDER BY date DESC), 0))) OVER (),0) AS TotalGlobalCosteMediasDietas,
-- Clculo del coste de las COMIDAS por empleado
isnull(SUM(pt.DietasComida * TRY_CONVERT(DECIMAL(10,2), ISNULL((SELECT TOP(1) replace(substring(Value,1,50),',', '.') 
FROM EmployeeUserFieldValues EUFV 
WHERE EUFV.idemployee = emp.id AND date <= CAST(@endDate AS DATE) AND fieldname = 'PrecioComida' 
ORDER BY date DESC), 0))) OVER (partition by emp.id),0) AS CosteComidas,
-- Clculo del coste de las COMIDAS global
isnull(SUM(pt.DietasComida * TRY_CONVERT(DECIMAL(10,2), ISNULL((SELECT TOP(1) replace(substring(Value,1,50),',', '.') 
FROM EmployeeUserFieldValues EUFV 
WHERE EUFV.idemployee = emp.id AND date <= CAST(@endDate AS DATE) AND fieldname = 'PrecioComida' 
ORDER BY date DESC), 0))) OVER (),0) AS TotalGlobalCosteComidas 
from Employees emp
inner join ESP_PARTESTRABAJO pt ON pt.IDEmpleado = emp.ID and pt.Proyecto >= @startProject and pt.Proyecto <= @endProject
inner join sysrovwSecurity_PermissionOverEmployees poe WITH (NOLOCK) On poe.IDPassport =  @idPassport And poe.IDEmployee = emp.ID And cast(pt.Fecha as date) between poe.BeginDate And poe.EndDate
inner join sysrovwAllEmployeeGroups eg on emp.ID = eg.IDEmployee
where cast(pt.Fecha as date) BETWEEN cast(@startDate as date) AND cast(@endDate as date)   
OPTION (USE HINT('ASSUME_JOIN_PREDICATE_DEPENDS_ON_FILTERS'))
RETURN NULL
GO

